import React from "react";

class Buttons9aa extends React.Component {
  constructor(props) {
    super(props);
    this.state = { color: "" };
  }

  changeColor = (event) => {
    this.setState({ color: event.target.value });
  };
  render() {
    return (
      <div>
        <button
          type="button"
          style={{
            backgroundColor: "red",
            width: "250px",
            height: "160px",
            margin: "20px",
          }}
          onClick={this.changeColor}
        >
          {this.state.color}
        </button>
      </div>
    );
  }
}

export default Buttons9aa;
